import React, { useState } from 'react'
import { useTable, useSortBy, useExpanded, usePagination } from 'react-table'
import { Link } from 'react-router-dom';
function Table({ columns: userColumns, data }) {
    const {
        getTableProps,
        getTableBodyProps,
        headerGroups,

        prepareRow,
        page,
        canPreviousPage,
        canNextPage,
        pageOptions,
        pageCount,
        gotoPage,
        nextPage,
        previousPage,
        setPageSize,
        state: {  pageIndex, pageSize },
    } = useTable(
        {
            columns: userColumns,
            data,
            initialState: { pageIndex: 0 },
        },
        useSortBy,
        usePagination // We can useExpanded to track the expanded state
        // for sub components too!
    )

    return (
        <div>
            <table {...getTableProps()}  className="module-grid fullWidthPopup">
                <thead>
                    {headerGroups.map(headerGroup => (
                        <tr {...headerGroup.getHeaderGroupProps()}>
                            {headerGroup.headers.map(column => (
                                <th {...column.getHeaderProps(column.getSortByToggleProps())}>
                                    {column.render('Header')}
                                    <span>
                                        {column.isSorted ? (!column.isSortedDesc ? ' ðŸ”¼' : ' ðŸ”½') : ''}
                                    </span>
                                </th>
                            ))}
                        </tr>
                    ))}
                </thead>
                <tbody {...getTableBodyProps()}>
                    {page.map((row, i) => {
                        prepareRow(row)
                        return (
                            // Use a React.Fragment here so the table markup is still valid
                            <React.Fragment {...row.getRowProps()}>
                                <tr>
                                    {row.cells.map(cell => {
                                        return (
                                            <td {...cell.getCellProps()}>{cell.render('Cell')}</td>
                                        )
                                    })}
                                </tr>
                            </React.Fragment>
                        )
                    })}
                </tbody>
            </table>
            <br />
            <div className="col-md-12 pagination grid-pagination">
                <div className="col-md-4">
                    <div className="form-group">
                        <select className="form-control"
                            value={pageSize}
                            onChange={e => {
                                setPageSize(Number(e.target.value))
                            }}
                        >
                            {[3,5 , 120, 40, 50].map(pageSize => (
                                <option key={pageSize} value={pageSize}>
                                    {pageSize}
                                </option>
                            ))}
                        </select>
                        <span className='m-l-10'>Records Per Page</span>
                    </div>
                </div>
                <div className="col-md-3 form-group">
                    <div className="form-group">
                        <span>
                            Page{' '}
                        </span>
                        <input
                            className="form-control m-l-10 "
                            type="number"
                            defaultValue={pageIndex + 1}
                            onChange={e => {
                                const page = e.target.value ? Number(e.target.value) - 1 : 0
                                gotoPage(page)
                            }}
                        />
                        <span className="m-l-10">of {pageOptions.length}</span>
                    </div>
                </div>
                <div className="col-md-5">
                    <ul>
                        <li onClick={() => gotoPage(0)} disabled={!canPreviousPage}><a href="#">First</a></li>
                        <li onClick={() => previousPage()} disabled={!canPreviousPage}><a href="#">Prev</a></li>
                        <li onClick={() => gotoPage(pageIndex + 1)}><a href="#">{pageIndex + 1}</a></li>
                        <li onClick={() => gotoPage(pageIndex + 1)}><a href="#">{pageIndex + 2}</a></li>
                        <li onClick={() => nextPage()} disabled={!canNextPage}><a href="#">Next</a></li>
                        <li onClick={() => gotoPage(pageCount - 1)} disabled={!canNextPage}><a href="#">Last</a></li>
                    </ul>

                </div>
            </div>
        </div>
    )
}
function DataGrid(props) {
    const columnList = props.columns;
    let columns = [];
    columnList.forEach(element => {
        const obj = {};
        obj.Header = element.Header;
        obj.accessor = element.accessor;
        if (element.filterable) {
            obj.filterable = true;
        }
        if (element.width) {
            obj.width = element.width;
        }
        if (element.disableSortBy) {
            obj.disableSortBy = true;
        }
        if (element.accessor === 'index') {
            obj.Cell = (row) => {
                return <div>{row.row.index + 1}</div>;
            }
        }
        if (element.accessor === 'count') {
            obj.Cell = param => {
                const rowData = param.row.original;
                return <div className="add-material"><a href="#" onClick={() => props.onGetList(rowData.id)}>{rowData.subRowsCount}</a>
                    <a
                        href="#"
                        onClick={() => props.onOpenModal(rowData.id)}
                    >
                        <img src={process.env.PUBLIC_URL + "/images/plus.svg"} alt />
                        <span>Add More</span>
                    </a>
                </div>
            }
        }
        if (element.accessor === 'dataStatus') {
            obj.Cell = param => {
                const rowData = param.row.original;
                const status = rowData.dataStatus ? parseInt(rowData.dataStatus) : 0;
                return (<div className="cell-components">
                    <div className="custom-control custom-switch">
                        <input
                            type="checkbox"
                            className="custom-control-input"
                            id={`changeStatus-${rowData.id}`}
                            onChange={() => props.onChangeStatus(rowData.id, !status)}
                            checked={status}
                        />
                        <label
                            className="custom-control-label"
                            htmlFor={`changeStatus-${rowData.id}`}
                        />
                    </div>
                </div>
                )
            }
        }
        if (element.accessor === 'dataSelect') {
            obj.Cell = param => {
                const rowData = param.row.original;
                return (<div className="cell-components">
                    <div className="custom-control custom-switch">
                       <button className="btn accept-btn" onClick={() => props.onChangeSelect(rowData.id, 1)}>Accept</button>
                       <button className="btn reject-btn"  onClick={() => props.setRejectionId(rowData.id)}>Reject</button>
                    </div>
                </div>
                )
            }
        }
        if (element.accessor === 'view') {
            obj.Cell = param => {
                const rowData = param.row.original;
                return (<div className="cell-components">

                            <button className="btn btn-action" onClick={() => props.onOpenMaterialViewModal(rowData.id)}>
                                     <span className="fa fa-eye light-grey"></span>
                            </button>
                        </div>
                )
            }
        }
        if (element.accessor === 'edit') {
            obj.Cell = param => {
                const rowData = param.row.original;
                return (<div className="cell-components">
                    <button className="btn"
                        data-toggle="modal"
                        data-target="#moduleedit"
                        onClick={() => props.onEdit(rowData.id)}
                    >
                        <img src={process.env.PUBLIC_URL + "/images/edit.svg"} alt />
                    </button></div>
                )
            }
        }

        if (element.accessor === 'delete') {
            obj.Cell = param => {
                const rowData = param.row.original;
                return (<div className="cell-components">
                    <button className="btn"
                        onClick={() => props.onDelete(rowData.id)}
                    >
                        <img src={process.env.PUBLIC_URL + "/images/delete.svg"} alt />
                    </button></div>
                )
            }
        }

        columns.push(obj);

    });
    columns = React.useMemo(() => columns)

    return (
        // <div></div>
        <Table columns={columns} data={props.data} />
    )
}

export default DataGrid
